  return (
    <>
      <Navbar />
      <Container
        sx={{
          position: 'relative',
          backgroundImage: `url(${background})`,
          backgroundRepeat: 'no-repeat',
          backgroundSize: 'cover',
          height: '600px',
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          textAlign: 'center',
        }}
      >
        <Box>
          <img src={logo} height="200px" />
          <Box mt={2}>
            <Button
              variant="contained"
              color="primary"
              size="large"
              sx={{ margin: '8px' }}
            >
              Single Player
            </Button>
            <Button
              variant="contained"
              color="secondary"
              size="large"
              sx={{ margin: '8px' }}
            >
              Multiplayer
            </Button>
          </Box>
        </Box>
      </Container>
    </>
  );
};

export default Game;
